import React from 'react'
import NavButton from './NavButton/NavButton'

function NavBar() {
    return (
        <div>
            <NavButton name="Resume" />
            <NavButton name="LinkedIn" />
            <button onClick={this.props.handleClick}>What</button>
        </div>
    )

}

export default NavBar;
